import { useEffect, useState } from "react";

const Test = () => {
  const [api, setApi] = useState([]);

  const getAPI = async function () {
    const res = await fetch(
      "https://6245b93d6b7ecf057c23abe2.mockapi.io/products"
    );
    const data = await res.json();
    setApi(data);
  };

  useEffect(() => {
    getAPI();
  }, []);

  return (
    <ul>
      {api.map((ele) => (
        <li>{ele.name}</li>
      ))}
    </ul>
  );
};
export default Test;
